void hypercounter::output_hdvs_to_file(const string &path)
{
    ofstream output_file( path, ios::out );
    size_t M = hdvs.size();
    for (size_t i = 0; i != M; ++i)
    {
        size_t N = hdvs[i].size();
        output_file << i;
        for (size_t j = 0; j != N; ++j)
        {
            if (hdvs[i][j] != 0) { output_file << " " << j << ":" << hdvs[i][j]; }
        }
        output_file << " #" << i << "\n";
    }
}

void hypercounter::output_sdvs_to_file(const string &path)
{
    ofstream output_file( path, ios::out );
    size_t M = sdvs.size();
    for (size_t i = 0; i != M; ++i)
    {
        size_t N = sdvs[i].size();
        output_file << i;
        for (size_t j = 0; j != N; ++j)
        {
            if (sdvs[i][j] != 0) { output_file << " " << j << ":" << sdvs[i][j]; }
        }
        output_file << " #" << i << "\n";
    }
}
